import React from "react";
import { Box, Button } from "@mui/material";

export default function Buttons({ selectedDate, onOkClick, onCancelClick }) {
  return (
    <Box
      sx={{
        display: "flex",
        justifyContent: "space-between",
        marginTop: 2,
        width: "100%",
      }}
    >
      {/* Cancel Button */}
      <Button variant="outlined" color="secondary" onClick={onCancelClick}>
        Cancel
      </Button>

      {/* OK Button */}
      <Button
        variant="contained"
        color="primary"
        onClick={onOkClick}
        disabled={!selectedDate} // Disable button if no date is selected
        sx={{
          backgroundColor: selectedDate ? "primary.main" : "grey.300",
          "&:hover": {
            backgroundColor: selectedDate ? "primary.dark" : "grey.300",
          },
        }}
      >
        OK
      </Button>
    </Box>
  );
}
